import React, { useState, useEffect} from 'react'

function Index() {
    const [,setLoading] = useContext(LoadingContext);
    useEffect(() => {
        setLoading(false)
      },[]);
  return (
    <div class="wrapper">
        <div class="container-fluid">
            <div class="row">
                <div class="col-12">
                    <div class="card">
                        <div class="card-body">         
                            <div>
                                <p>About</p>
                            </div>
                        </div>
                    </div>
                </div>
            </div>
        </div>
    </div>
)

}

export default Index
